import React from 'react';
import { Box, Grid, FormControl, InputLabel, OutlinedInput, makeStyles } from '@material-ui/core';
import { SectionHeading } from '../Component';
import './Css/Contact.scss';

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const ContactForm = () => {
    const classes = useStyles();
    return (
        <>
            <section>
                <Box className="contactSec my-5">
                    <Grid container>
                        <Grid item lg={6} md={8} xs={10} className={classes.margin}>
                            <Box>
                                <SectionHeading head="Contact Us" />
                                <Box>
                                    <form>
                                        <FormGroup style={{ marginBottom: ".2rem" }}>
                                            <FormControl className={classes.margin} fullWidth variant="outlined">
                                                <InputLabel htmlFor="outlined-email">Email or phone</InputLabel>
                                                <OutlinedInput labelWidth={115} type="text" name="email" onChange={userInput} value={data.email} required />
                                                <FormHelperText className={classes.errorMsg}>{errorMsg}</FormHelperText>
                                            </FormControl>
                                        </FormGroup>
                                    </form>
                                </Box>
                            </Box>
                        </Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default ContactForm
